import React, {useState, useEffect} from "react";

export const LeaderboardList = ({item}) => {
    return (
        <>
            <li className="leaderboard__board-list">
                <p className="all lp">
                    {item.id}
                </p>
                <p className="all username">
                    {item.nickname}
                </p>
                <p className="all moves">
                    {item.moves}
                </p>
                <p className="all time">
                    {item.time}
                </p>
            </li>
        </>
    )
}
